// server.js
const express = require('express');
const cors = require('cors');
const compression = require('compression'); // Для сжатия ответов
const rateLimit = require('express-rate-limit'); // Для ограничения скорости запросов
const { body, validationResult } = require('express-validator'); // Для валидации
const morgan = require('morgan'); // Для логирования
const app = express();

// Настройка CORS для разрешения запросов с любых доменов
app.use(cors());

// Применяем сжатие
app.use(compression());

// Настройка логирования
app.use(morgan('combined'));

// Настройка Rate Limiting
const limiter = rateLimit({
    windowMs: 15 * 60 * 1000, // 15 минут
    max: 1000, // максимум 1000 запросов с одного IP за windowMs
    message: 'Слишком много запросов с этого IP, пожалуйста, попробуйте позже.',
});
app.use(limiter);

// Middleware для парсинга JSON
app.use(express.json({ limit: '10mb' })); // Увеличьте лимит, если необходимо

// Настройка режима работы: всегда использовать заглушку
const USE_MOCK = true; // Установите в true для использования заглушки
const MIN_DELAY_MS = 1000; // Минимальная задержка в миллисекундах (1 секунда)
const MAX_DELAY_MS = 5000; // Максимальная задержка в миллисекундах (5 секунд)

// Предопределенные Base64 строки для трех растений
const rosaImageBase64 = "data:image/jpeg;base64,";
